Envie:
- d’aider, de me rendre utile;
- de contribuer;
- d’apprendre;

- Améliorer mes competences dans l'art d'influence et autres atouts de leadeship 
- Contribuer à la réalisation de la mission de JMTF par la sensibilisation de la population  surtout celle ayant en partage la lague francaise.
- developper un moyen de gagner de l'argent en apprenant à apprendre les autres l'art de leadeship;

1. j'aime la connaissance de soi;
2. j'aime la famille JMT;
3. je voudrais faire équipe avec Patricia et les autres dans ce projet et amener le DISC en France;
